        "home-history-1760": "Ang orihinal na pangalan ng bayan ay Bintauan, isang pamayanan ng mga Gaddang na ngayon ay barangay ng Villaverde.",
        "home-history-1767": "Ang bayan ay pormal na itinatag ni Padre Alejandro Vidal, isang paring Dominikano na namuno sa isang misyong Espanyol.",
        "home-history-1768": "Pinangalanang Lungabang, mula sa salitang Gaddang na lungab na nangangahulugang kuweba. Kalaunan ay binago ng mga Espanyol sa Lumabang.",
